<?phpnamespace Nemundo\WebLog\Data\BrowserAgent;class BrowserAgentReader extends \Nemundo\Model\Reader\ModelDataReader {/*** @var BrowserAgentModel*/public $model;public function __construct() {parent::__construct();$this->model = new BrowserAgentModel();}/*** @return BrowserAgentRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = $this->getModelRow($dataRow);$list[] = $row;}return $list;}/*** @return BrowserAgentRow*/public function getRow() {$dataRow = parent::getRow();$row = $this->getModelRow($dataRow);return $row;}/*** @return BrowserAgentRow*/public function getRowById($id) {return parent::getRowById($id);}private function getModelRow($dataRow) {$row = new BrowserAgentRow($dataRow, $this->model);$row->model = $this->model;return $row;}}